import { useEffect } from 'react';
import Home from './pages/Home';

const App = () => {
  useEffect(() => {
    document.querySelector('html').setAttribute('data-theme', 'light');
  }, []);

  return (
    <>
      <Home />
    </>
  );
};

export default App;
